
class Carroceria {
    private _cantidadPuertas: number;
    private _numeroSerie: number;

    constructor( cantidadPuertas: number, numeroSerie: number) {
        this._cantidadPuertas = cantidadPuertas;
        this._numeroSerie= numeroSerie;
    }

    mostrar(): string {
        return `Cantidad de Puertas: ${this._cantidadPuertas}  Numero de Serie: ${this._numeroSerie}`;
    }
}

export default Carroceria;